import { Box, Button, FormControl, InputLabel, MenuItem, Select } from '@mui/material';
import React, { useState } from 'react';

function MergedSelectComponent({
  type,
  onFoodChange,
  onCustomPeriodChange,
  onMealTypeChange,
  onCourtTypeChange,
  onCourtTimeChange,
  onGymTimeChange,
}) {
  const [foodChoice, setFoodChoice] = useState('');
  const [mealType, setMealType] = useState('');
  const [customPeriod, setCustomPeriod] = useState('');
  const [courtChoice, setCourtChoice] = useState('');
  const [courtTime, setCourtTime] = useState('');
  const [gymTime, setGymTime] = useState('');
  const [submitChoice, setSubmitChoice] = useState('');

  const handleSubmit = () => {
    const bookingDetails = {
      food: { foodChoice, customPeriod, mealType },
      court: { courtChoice, courtTime },
      gym: { gymTime },
    };
    
    // Submit the details (for now, just log the values)
    console.log('Booking Details:', bookingDetails);
  };

  return (
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'flex-start',
        boxShadow: 3,
        padding: '20px',
        borderRadius: '8px',
        backgroundColor: 'white',
        width: '48%',
        marginTop: 3,
      }}
    >
      <h3>Book your {type}</h3>

      {/* Handle based on the type passed (food, court, gym) */}
      {type === 'food' && (
        <>
          <FormControl sx={{ m: 1, minWidth: 120 }}>
            <InputLabel id="food-choice-label">Food Choice</InputLabel>
            <Select
              labelId="food-choice-label"
              value={foodChoice}
              onChange={(event) => {
                setFoodChoice(event.target.value);
                onFoodChange(event.target.value);
              }}
            >
              <MenuItem value="food1">Food 1</MenuItem>
              <MenuItem value="food2">Food 2</MenuItem>
            </Select>
          </FormControl>

          <FormControl sx={{ m: 1, minWidth: 120 }}>
            <InputLabel id="custom-period-label">Custom Period</InputLabel>
            <Select
              labelId="custom-period-label"
              value={customPeriod}
              onChange={(event) => {
                setCustomPeriod(event.target.value);
                onCustomPeriodChange(event.target.value);
              }}
            >
              <MenuItem value="period1">Period 1</MenuItem>
              <MenuItem value="period2">Period 2</MenuItem>
            </Select>
          </FormControl>

          <FormControl sx={{ m: 1, minWidth: 120 }}>
            <InputLabel id="meal-type-label">Meal Type</InputLabel>
            <Select
              labelId="meal-type-label"
              value={mealType}
              onChange={(event) => {
                setMealType(event.target.value);
                onMealTypeChange(event.target.value);
              }}
            >
              <MenuItem value="meal1">Meal 1</MenuItem>
              <MenuItem value="meal2">Meal 2</MenuItem>
            </Select>
          </FormControl>
        </>
      )}

      {type === 'court' && (
        <>
          <FormControl sx={{ m: 1, minWidth: 120 }}>
            <InputLabel id="court-choice-label">Court Choice</InputLabel>
            <Select
              labelId="court-choice-label"
              value={courtChoice}
              onChange={(event) => {
                setCourtChoice(event.target.value);
                onCourtTypeChange(event.target.value);
              }}
            >
              <MenuItem value="court1">Court 1</MenuItem>
              <MenuItem value="court2">Court 2</MenuItem>
            </Select>
          </FormControl>

          <FormControl sx={{ m: 1, minWidth: 120 }}>
            <InputLabel id="court-time-label">Court Time</InputLabel>
            <Select
              labelId="court-time-label"
              value={courtTime}
              onChange={(event) => {
                setCourtTime(event.target.value);
                onCourtTimeChange(event.target.value);
              }}
            >
              <MenuItem value="time1">Time 1</MenuItem>
              <MenuItem value="time2">Time 2</MenuItem>
            </Select>
          </FormControl>
        </>
      )}

      {type === 'gym' && (
        <FormControl sx={{ m: 1, minWidth: 120 }}>
          <InputLabel id="gym-time-label">Gym Time</InputLabel>
          <Select
            labelId="gym-time-label"
            value={gymTime}
            onChange={(event) => {
              setGymTime(event.target.value);
              onGymTimeChange(event.target.value);
            }}
          >
            <MenuItem value="gym1">Gym Time 1</MenuItem>
            <MenuItem value="gym2">Gym Time 2</MenuItem>
          </Select>
        </FormControl>
      )}

      {/* Submit Section */}
      <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'flex-start', marginTop: 3 }}>
        <h3>Submit your choices</h3>
        <FormControl sx={{ m: 1, minWidth: 120 }}>
          <InputLabel id="submit-select-label">Submit</InputLabel>
          <Select
            labelId="submit-select-label"
            id="submit-select"
            value={submitChoice}
            label="Submit"
            onChange={(event) => setSubmitChoice(event.target.value)}
          >
            <MenuItem value="submit">Submit</MenuItem>
            <MenuItem value="reset">Reset</MenuItem>
          </Select>
        </FormControl>

        <Box sx={{ display: 'flex', justifyContent: 'center', marginTop: '20px', width: '100%' }}>
          <Button
            variant="contained"
            color="primary"
            onClick={handleSubmit}
            disabled={submitChoice !== 'submit'}
          >
            Submit All Choices
          </Button>
        </Box>
      </Box>
    </Box>
  );
}

export default MergedSelectComponent;
